import { createSelector } from '@reduxjs/toolkit';
import { initialState } from './slice';

const selectSlice = (state) => initialState;

export const selectLocations = createSelector(
    [selectSlice],
    state => state,
  );

  export const locationListErrors = createSelector(
    [selectReturnsManagement],
    state => state.returnsManagementSearchErrors,
  );  
export const locationSelector = state => state.locations;
